tables.table_schema:
CREATE TABLE ProteinStructures (
    protein_id UUID PRIMARY KEY,
    structure_name TEXT NOT NULL,
    resolution FLOAT,
    structure_data BYTES
);

CREATE TABLE GeometricParameters (
    parameter_id UUID PRIMARY KEY,
    protein_id UUID REFERENCES ProteinStructures(protein_id),
    parameter_name TEXT NOT NULL,
    parameter_value FLOAT
);

CREATE TABLE proteins (
    protein_id INT PRIMARY KEY,
    protein_name VARCHAR(255) NOT NULL,
    protein_sequence TEXT
);

CREATE TABLE structures (
    structure_id INT PRIMARY KEY,
    protein_id INT,
    structure_name VARCHAR(255) NOT NULL,
    resolution FLOAT
);

CREATE TABLE geometric_params (
    param_id INT PRIMARY KEY,
    structure_id INT,
    param_name VARCHAR(255) NOT NULL,
    param_value FLOAT
);

CREATE TABLE ProteinStructures (
    structure_id INT PRIMARY KEY,
    structure_name VARCHAR(255),
    author_id INT,
    resolution FLOAT
);

CREATE TABLE ProteinChains (
    chain_id CHAR PRIMARY KEY,
    structure_id INT,
    chain_name VARCHAR(10),
    length INT
);
